    "# drop_first=False를 사용하여 모든 카테고리에 대한 더미 변수를 생성합니다.\n",
    "time_category_dummies = pd.get_dummies(df_1['시간대_구분'], prefix='시간대', dtype=int)\n",
    "df_1 = pd.concat([df_1, time_category_dummies], axis=1)\n",
    "\n",
