    "- 클러스터 1은 평균 혼잡도와 최대 혼잡도가 가장 높고, 불쾌지수도 가장 높은 그룹입니다. 기온은 가장 높고, 강수량도 가장 많습니다.\n",
    "- 클러스터 0은 중간 정도의 혼잡도와 불쾌지수를 보이며, 기온과 강수량도 중간 수준입니다.\n",
    "- 클러스터 2는 평균 혼잡도와 불쾌지수가 매우 낮고, 기온도 매우 낮으며, 강수량도 거의 없는 특이한 그룹입니다. 역이 3개로 매우 적어 특수한 환경이나 데이터 특성을 가진 역일 가능성이 큽니다."
