    "coefficients_sorted = coefficients.abs().sort_values(ascending=False)\n",
    "coefficients_to_plot = coefficients[coefficients_sorted.index] # 정렬된 순서대로 원본 계수 값 가져오기\n",
    "\n",
    "# 상위 N개 피처만 시각화 (너무 많으면 여전히 복잡할 수 있으므로)\n",
